import React from 'react';
import { Container, Typography, Button, Box } from '@mui/material';

function Hero() {
  return (
    <Box sx={{ backgroundColor: '#00522D', paddingY: 10, textAlign: 'center', color: '#ffffff' }}>
      <Container maxWidth="md">
        <Typography variant="h3" gutterBottom>
          Join the Best Online Fishing Tournaments
        </Typography>
        <Typography variant="body1" gutterBottom>
          Compete, win prizes, and enjoy a seamless experience from anywhere, anytime.
        </Typography>
        <Button variant="contained" color="secondary" size="large" href="#signup">
          Get Started
        </Button>
      </Container>
    </Box>
  );
}

export default Hero; // Ensure this is a default export
